#include <string>
#include <vector>
#include <map>
#include <iostream>

using namespace std;

class Solution {
public:
	char findTheDifference(string s, string t) {
		
		char ans = '\0';
		string temp = s + t;
		for (int i = 0; i < temp.length(); i++)
			ans = ans ^ temp[i];
		return ans;
	}
};

int main() {
	string s = "";
	string t = "";

	Solution a;
	cout << a.findTheDifference(s, t);
	return 0;
}